  id:"amount",
  operator:"gte",
  values: 100
},{
  id:"merchant",
  operator:"eq",
  values: 'swiggy'
}]
The filters can be multiple or single, and are stored in an array format and follow the AND rule, meaning all filters must be valid for the transaction to be counted as valid. For example, a filter may check if the transaction value is greater than or equal to 100, if not, it fails, and if so, it proceeds to check if the merchant is Swiggy. Only if both are true, it updates the Mission progress. There are additional processes involved in marking Missions as successful for a user, but that's beyond the scope of this blog.Other internal APIs include creation of rewards, handling ads, managing brands, and more.Event stream handlerAt FamPay, our backend is composed of microservices that utilise Kafka as our primary inter-service communication tool. While event stream handling and task scheduling are closely related, we'll cover each topic separately to provide a more comprehensive understanding.In FamPay's backend architecture, the event relay service acts as the connection hub between services, ensuring data integrity at all times. Meanwhile, the event stream handler, which is implemented in the engagement service, maintains a ledger of all processed events and performs pre-processing to guarantee that data is consistently in the correct format. To illustrate, our primary transaction service emits events for various monetary transactions, and it's the handler's responsibility to inform the scheduler of the event type (e.g., payment, reversal) in order to create and schedule relevant tasks. Additionally, the event stream handler safeguards the service from malicious events.The reason for handling reversals is to ensure that malicious users don’t take advantage of the feature by reversing their transactions

