class Client(object):

	def __init__(self):
		self.queue = queue.Queue(1000)	

	def enqueue(self, task_name):
		message = {
			"task_name":task_name
		}

		try:
			self.queue.put(message, block=False)
			return True, message
		except queue.Full:
			raise queue.Full
Cool! That's a minimal client we can work with. Instance of this client will maintain a queue of size 1000, and provide a method enqueue to push tasks into queue.But we need only 1 queue globally for our use case and hence a single instance should be maintained throughout the application. Now this is a small concern, how do we make sure that a global single instance is maintained for this client? Maybe we can initialize it when the main process starts? Yes, we can do that, but there is a simpler and better solution.We will enqueue these tasks through a function which will make sure that a global instance of this client exists; otherwise, it will create one, so it will be initialized when 1st task is enqueued.from .client import Client

default_client = None

__all__=["add_to_queue"]

def add_to_queue(task_name):
	"""
	Enqueues task in in-memory queue if global instance of client exist,
	otherwise initializes a single global instance and pushes the task.		
	"""
	global default_client

	if not default_client:
		default_client = Client()

	default_client.enqueue(task_name)

Nice! That looks good, we are maintaining a global client,
